import React,{Component} from 'react';
import {Row,Col,Container} from 'react-bootstrap';

class home extends Component{

    render(){
        return(
            <>
                <Container>
                    <Row>
                        <Col>1</Col>
                        <Col>2</Col>
                        <Col>3</Col>
                    </Row>
                </Container>
            </>
        );
    }
}

export default home;
